import React, { useState } from 'react';

export default function Index() {
    const [search, setSearch] = useState('');
    const [category, setCategory] = useState('');

    const allData = [
        {
            name: "Dell g16",
            category: "Gaming Laptop",
            price: 119999,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "HP OMEN",
            category: "Gaming Laptop",
            price: 169999,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "ASUS ROG",
            category: "Gaming Laptop",
            price: 164999,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "alienware",
            category: "Gaming Laptop",
            price: 129999,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "HP victus",
            category: "Gaming Laptop",
            price: 138999,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "Pagani Utopia",
            category: "Super Cars",
            price: 12999999,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "aston martin",
            category: "Super Cars",
            price: 87560500,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "lemborgini Huracan",
            category: "Super Cars",
            price: 45000000,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "bugatti Chiron",
            category: "Super Cars",
            price: 235450000,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "bentley continental gt",
            category: "Super Cars",
            price: 30500000,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "Levi's Denim Jacket",
            category: "clothes",
            price: 3499,
            img: "data:image/jpeg;base64,"
        },
        {
            name: "Nike Sports T-shirt",
            category: "clothes",
            price: 1999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Adidas Running Shoes",
            category: "clothes",
            price: 4999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Zara Casual Shirt",
            category: "clothes",
            price: 2599,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "H&M Slim Fit Jeans",
            category: "clothes",
            price: 2999,
            img: "data:image/jpeg;base64,",
        },
    ];

    const filteredData = allData.filter((item) =>
        (category === "" || item.category === category) &&
        item.name.toLowerCase().includes(search.toLowerCase())
    );

    return (
        <div className="container">
            <h1>PRODUCT'S  LIST</h1>
            <div className="filter-section">
                <input id="search-input" type="text" className="search-bar" value={search} onChange={(e) => setSearch(e.target.value)} placeholder="Search" />
                <select id="category-select" className="category-dropdown" value={category} onChange={(e) => setCategory(e.target.value)}>
                    <option value="">All Categories</option>
                    <option value="Gaming Laptop">Gaming Laptop</option>
                    <option value="Super Cars">Super Cars</option>
                    <option value="clothes">clothes</option>
                </select>
            </div>

            <div className="product-list">
                {
                    filteredData.map((e, i) => {
                        return <div key={i} className="product-item">
                            <img className="product-image" src={e.img} />
                            <h3 className="product-name">{e.name}</h3>
                            <p className="product-price">Price: ₹{e.price}</p>
                        </div>
                    })
                }
            </div>
        </div>
    );
}
